<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Secure Mavoko Land Map</title>
  <meta name="viewport" content="width=device-width, initial-scale=1.0">

  <!-- Leaflet CSS & JS -->
  <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css" />
  <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>

  <!-- Locate Control -->
  <link rel="stylesheet" href="https://unpkg.com/leaflet.locatecontrol@0.78.0/dist/L.Control.Locate.min.css" />
  <script src="https://unpkg.com/leaflet.locatecontrol@0.78.0/dist/L.Control.Locate.min.js"></script>

  <!-- Firebase -->
  <script src="https://www.gstatic.com/firebasejs/9.6.1/firebase-app-compat.js"></script>
  <script src="https://www.gstatic.com/firebasejs/9.6.1/firebase-auth-compat.js"></script>

  <style>
    html, body { height: 100%; margin: 0; }
    #map { height: 100vh; width: 100%; display: none; }

    /* Login page */
    #loginForm {
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      height: 100vh;
    }

    #logoutBtn {
      position: fixed;
      top: 10px;
      right: 20px;
      background: red;
      color: white;
      border: none;
      padding: 8px 14px;
      border-radius: 6px;
      cursor: pointer;
      display: none;
      z-index: 1000;
    }

    /* Bottom right info box */
    #userInfo {
      position: fixed;
      bottom: 10px;
      right: 15px;
      background: rgba(255, 255, 255, 0.9);
      padding: 10px 14px;
      border-radius: 8px;
      box-shadow: 0 2px 8px rgba(0,0,0,0.25);
      font-weight: bold;
      font-size: 0.9rem;
      display: none;
      z-index: 1000;
    }

    #dateTime {
      display: block;
      font-size: 0.85rem;
      font-weight: normal;
      color: #444;
    }

    /* Auto-suggest search box */
    #searchBox {
      position: fixed;
      top: 10px;
      left: 50%;
      transform: translateX(-50%);
      z-index: 1000;
      background: white;
      border-radius: 6px;
      box-shadow: 0 2px 6px rgba(0,0,0,0.25);
      padding: 5px;
      display: none;
    }

    #searchInput {
      width: 220px;
      padding: 6px;
      border: 1px solid #ccc;
      border-radius: 4px;
    }

    #suggestions {
      max-height: 150px;
      overflow-y: auto;
      border-top: 1px solid #ccc;
      margin-top: 5px;
      display: none;
      background: #fff;
    }

    #suggestions div {
      padding: 6px;
      cursor: pointer;
    }

    #suggestions div:hover {
      background: #eee;
    }
  </style>
</head>
<body>
  <!-- Logout Button -->
  <button id="logoutBtn">Logout</button>

  <!-- Bottom right info -->
  <div id="userInfo"></div>

  <!-- Login form -->
  <div id="loginForm">
    <h2>Secure Mavoko Land Map Login</h2>
    <input type="email" id="email" placeholder="Email" /><br>
    <input type="password" id="password" placeholder="Password" /><br>
    <button id="loginBtn">Login</button>
    <p id="loginMsg" style="color:red;"></p>
  </div>

  <!-- Map container -->
  <div id="map"></div>

  <!-- Search box -->
  <div id="searchBox">
    <input type="text" id="searchInput" placeholder="Search Parcel No..." />
    <div id="suggestions"></div>
  </div>

    const firebaseConfig = {
      apiKey: "AIzaSyAv9sckMh22FTjrnDQ0K4jxoMZ3alBRND8",
      authDomain: "my-land-phase3-2025.firebaseapp.com",
      projectId: "my-land-phase3-2025",
      storageBucket: "my-land-phase3-2025.firebasestorage.app",
      messagingSenderId: "53046594855",
      appId: "1:53046594855:web:a6a8553bbb341f72376d02"
    };

    firebase.initializeApp(firebaseConfig);
    const auth = firebase.auth();

    const loginForm = document.getElementById("loginForm");
    const mapDiv = document.getElementById("map");
    const loginBtn = document.getElementById("loginBtn");
    const loginMsg = document.getElementById("loginMsg");
    const logoutBtn = document.getElementById("logoutBtn");
    const userInfo = document.getElementById("userInfo");
    const searchBox = document.getElementById("searchBox");
    const searchInput = document.getElementById("searchInput");
    const suggestions = document.getElementById("suggestions");

    loginBtn.addEventListener("click", () => {
      const email = document.getElementById("email").value;
      const password = document.getElementById("password").value;
      auth.signInWithEmailAndPassword(email, password)
        .then(() => loginMsg.textContent = "")
        .catch(err => loginMsg.textContent = "Login failed: " + err.message);
    });

    logoutBtn.addEventListener("click", () => auth.signOut());

    // üß≠ Auth state change
    auth.onAuthStateChanged(user => {
      if (user) {
        loginForm.style.display = "none";
        mapDiv.style.display = "block";
        logoutBtn.style.display = "block";
        userInfo.style.display = "block";
        searchBox.style.display = "block";
        initMap(user.email);
      } else {
        loginForm.style.display = "flex";
        mapDiv.style.display = "none";
        logoutBtn.style.display = "none";
        userInfo.style.display = "none";
        searchBox.style.display = "none";
      }
    });

        attribution: "¬© Google"

      const parcelsLayer = L.geoJSON(geojsonData, {
        style: { color: "red", weight: 2, fillOpacity: 0 },
        onEachFeature: (feature, layer) => {
          layer.bindPopup(`<b>Parcel No:</b> ${feature.properties.Parcel_NO}`);
        }
      }).addTo(map);

      map.fitBounds(parcelsLayer.getBounds());

      // üß† Build search suggestion list
      const parcels = geojsonData.features.map(f => ({
        id: f.properties.Parcel_NO,
        layer: f
      }));

      // üîç Search with auto-suggest
      searchInput.addEventListener("input", () => {
        const value = searchInput.value.trim().toLowerCase();
        suggestions.innerHTML = "";
        if (!value) {
          suggestions.style.display = "none";
          return;
        }

        const matches = parcels.filter(p => p.id.toLowerCase().includes(value));
        if (matches.length > 0) {
          matches.forEach(match => {
            const div = document.createElement("div");
            div.textContent = match.id;
            div.onclick = () => {
              searchInput.value = match.id;
              suggestions.style.display = "none";
              zoomToParcel(match.id);
            };
            suggestions.appendChild(div);
          });
          suggestions.style.display = "block";
        } else {
          suggestions.style.display = "none";
        }
      });

      function zoomToParcel(parcelNo) {
        parcelsLayer.eachLayer(layer => {
          if (layer.feature.properties.Parcel_NO === parcelNo) {
            map.fitBounds(layer.getBounds());
            layer.openPopup();
          }
        });
      }

      // ‚è∞ Live time updater (bottom right)
      function updateTime() {
        const now = new Date();
        userInfo.innerHTML = `Welcome, ${userEmail}<br><span id="dateTime">${now.toLocaleString()}</span>`;
      }
      updateTime();
      setInterval(updateTime, 1000);
    }
